webpackJsonp([0xad458e35aa6e],{350:function(e,i){e.exports={data:{site:{siteMetadata:{title:"signalwerk"}},markdownRemark:{html:'<h1 id="faustina"><a href="#faustina" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Faustina</h1>\n<p><small>Severin Kilchhofer</small></p>\n<div class="col1to12">\n<p><img src="/IAD2017.schriftmuster/faustina-5767164b42b865f742d6063f6139e6cd.svg" alt="Faustina"></p>\n</div>\n<ol>\n<li>Serife rechts und links beim H</li>\n<li>Doppelstöckiges a mit abgerundeten Anstrich</li>\n<li>Fähnchen nach links überragt Versalhöhe</li>\n<li>Dreistöckiges g mit Tropfen</li>\n<li>Schräger einengender Abstrich</li>\n<li>Ausgeprägte Serife beim S</li>\n</ol>\n<h2 id="design"><a href="#design" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Design</h2>\n<p>Faustina ist Bestandteil der neuen Omnibus-Type Press Serie und wurde von 2014-2015 entwickelt. Sie ist für den Einsatz in Büchern, Zeitungen und Zeitschriften gedacht. Egal ob gedruckt oder online. Es wurden bis jetzt acht verschiedene Schriftschnitte erstellt. Regular, Italic, Medium, Medium Italic, Semibold, Semibold Italic, Bold und Bold Italic. Die Schrift unterstützt mehr als 200 Sprachen. Jeder Schnitt hat eine hohe X Höhe und unterstützt somit die Lesbarkeit in Zeitungsartikeln zum Beispiel. So ist das lesen langer Texte sehr angenehm. Zusätzlich wurde jeder Schnitt für ein spezielles Ziel designt und bietet gute Kombinationsmöglichkeiten von Schnitt zu Schnitt. Beim Format handelt es sich um ein OpenType PostScript (.otf).</p>\n<h2 id="designer"><a href="#designer" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Designer</h2>\n<p>{{Text}}</p>\n<h4 id="quellen"><a href="#quellen" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Quellen</h4>\n<ol>\n<li><a href="http://www.omnibus-type.com/fonts/faustina">Omnibus-Type</a></li>\n<li><a href="http://...">Name der Quelle</a></li>\n</ol>',frontmatter:{date:"April 05, 2018",title:"Faustina"}}},pathContext:{slug:"/fonts/severin/"}}}});
